import re

def parse_hlt_monitoring_config(config):
    result = {}
    folder_match = re.search('', config)
    if folder_match:
        result['FolderName'] = folder_match.group(1)
    hlt_paths_match = re.search('hltPaths\\s*=\\s*\\[([^\\]]*)\\]', config)
    if hlt_paths_match:
        result['HLTPaths'] = re.findall('"(.*?)"', hlt_paths_match.group(1))
    jet_selection_match = re.search('jetSelection\\s*=\\s*\\"(.*?)\\"', config)
    if jet_selection_match:
        result['JetSelection'] = jet_selection_match.group(1)
    jet_id_match = re.search('jetId\\s*=\\s*\\"(.*?)\\"', config)
    if jet_id_match:
        result['JetId'] = jet_id_match.group(1)
    num_jets_match = re.search('njets\\s*=\\s*(\\d+)', config)
    if num_jets_match:
        result['NumJets'] = int(num_jets_match.group(1))
    return result

